import '../pages.css'
import Header from "../components/header";
import { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const navigate = useNavigate();

  const [email, setEmail] = useState();
  const [password, setPassword] = useState();
  const [firstName, setFirstName] = useState();
  const [lastName, setLastName] = useState();
  const [expertise, setExpertise] = useState();

  const data = {
    email: email, password: password, first_name: firstName,
    last_Name: lastName, expertise: expertise
  }

  const handleSubmit = (e) =>{
    e.preventDefault();

    axios.post(data, "http://127.0.0.1:1111/api/v1/register").then(
      () => { navigate("login")

      }).catch(() => {
        alert("error registering user");

      });
  }




  return (
    <>
      <Header />

      <div className="register-container">
        <h1 style={{ marginBottom: "20px" }}>Register</h1>
        <form onSubmit={handleSubmit} >
          <input type="text" name="email" placeholder="email"></input> <br />
          <input type="text" name="password" placeholder="password"></input><br />
          <input type="text" name="firstname" placeholder="first name"></input><br />
          <input type="text" name="lastname" placeholder="last name"></input><br />
          <input type="text" name="expertise" placeholder="expertise"></input><br />
          <button className="register-button">Register</button>
        </form>
        <h3>Forgot password?</h3>
        <p>---or---</p>
        <h3>Log in</h3>
      </div>
    </>
  );
};

export default Register;
